var data = {"data": [{"tags": ["list"], "text": "You lay on your side and bring your knees to your chest. You're tired, but you can't seem to shut your eyes. All you can do is think about what you could've had for dinner. Bread, quiche, pizza, meatballs, steak, pork buns...\n\n[[These are all things that you can't eat anymore.|apple]]", "created": "201410031548", "modified": "201410031548", "title": "43_2", "modifier": "twee"}, {"tags": ["list"], "text": "You chew slowly... but you hesitate before swallowing. You're alone in the apartment. Light spills in from your room, but it's dark outside, and there's no noise. There's nothing. If you choke on this, you could die, you tell yourself. There's no one here to save you now. \n\n[[Would it be better to starve, or to choke, you wonder?|45_2]]", "created": "201410031548", "modified": "201410031548", "title": "45", "modifier": "twee"}, {"tags": ["list"], "text": "Your friend walked around, commenting on everyone's stomach. She got to you and poked you, hard, right above the belly button. You could almost hear a squishing sound in your head, and she said \"your tummy is so round, Nina!\"\n\n[[Your phone is buzzing.|14_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "13_dinner_2", "modifier": "twee"}, {"tags": ["list"], "text": "You open a box of linguine and put half of it into the pot. You figure you'll bring some to work for lunch tomorrow. Also, Emmett, your boyfriend, will eat a lot anyways. \n\n[[Your phone has been buzzing. Check to see what's up.|14_dinner]]\n[[Look at yourself in the full-length mirror.|13_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "12_dinner", "modifier": "twee"}, {"tags": [], "text": "Mangia: A game by Nina Freeman\n\nTrigger warning: This game deals with chronic medical conditions, eating disorders and anxiety. \n\n[[Start.|1]]", "created": "201410031548", "modified": "201410031548", "title": "\ufeff:: Start", "modifier": "twee"}, {"tags": ["inline"], "text": "You strip off your clothes and crawl into bed, wrapping yourself up in your comforter. [[You don't even have the energy to brush your teeth.|43_2]]", "created": "201410031548", "modified": "201410031548", "title": "43", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"You sound upset--what's the matter anyways?\"|6_1_3]] she asks, with an annoyingly accusative tone. She always uses that tone.", "created": "201410031548", "modified": "201410031548", "title": "6_1_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You sigh, exasperated, and say, [[\"Nothing, I'm just tired. You know, school and whatever...\"|6_1_4]]", "created": "201410031548", "modified": "201410031548", "title": "6_1_3", "modifier": "twee"}, {"tags": ["inline"], "text": "Mom sounds more annoyed, as usual, and asks, [[\"What else could possibly be bothering you?\"|6_1_7]]", "created": "201410031548", "modified": "201410031548", "title": "6_1_6", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,2", "created": "201410031548", "modified": "201410031548", "title": "1_2", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Is something wrong with you and Emmett?\"|6_1_5]] she asks.", "created": "201410031548", "modified": "201410031548", "title": "6_1_4", "modifier": "twee"}, {"tags": ["list"], "text": "\"Oh my god mom, no, we're great.\" She always assumes that Emmett is the source of your problems, which couldn't be farther from the truth. \n\n[[You wonder why she doesn't ever ask if, for example, work is stressing you out.|6_1_6]]", "created": "201410031548", "modified": "201410031548", "title": "6_1_5", "modifier": "twee"}, {"tags": ["list"], "text": "You feel like you had the wind knocked out of you.\n\n\"I'm not ok, I have a condition.\"\n\n[[The words echo in your head: \"a condition.\" You're saying it over and over.|31_emmett2_2]]", "created": "201410031548", "modified": "201410031548", "title": "31_emmett2", "modifier": "twee"}, {"tags": ["list"], "text": "\"Well, get some rest,\" she says, \"I'm going to head out. I have to pick up Kevin from the therapist.\"\n\n[[\"Ok, bye,\" you say.|6_2]]", "created": "201410031548", "modified": "201410031548", "title": "6_1_8", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett says, [[\"I'm worried about you. Should I come meet you somewhere? Are you going to be ok? It sounds like you're crying.\"|32_emmett_2]]", "created": "201410031548", "modified": "201410031548", "title": "32_emmett", "modifier": "twee"}, {"tags": ["img"], "text": "mom,54", "created": "201410031548", "modified": "201410031548", "title": "53", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "pizza 2", "modifier": "twee"}, {"tags": ["list"], "text": "You have been dating Emmett for seven or eight months. His apartment is in Manhattan, and it's tiny, so he usually stays over at your place. In fact, he basically stays over every night. \n\n[[You run downstairs and open the door for Emmett.|15_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "15_dinner", "modifier": "twee"}, {"tags": ["inline"], "text": "You run to the bathroom--the black spots on the ceiling are still there. You text your landlord, because [[he was supposed to take care of that a while ago.|25_2]]", "created": "201410031548", "modified": "201410031548", "title": "25", "modifier": "twee"}, {"tags": ["inline"], "text": "Whenever you're feeling down, you tend to listen to the same kinds of music--droney, electronic, sad stuff. Today's mood feels pretty Flying Lotus, so you put that on. You always do this, and [[you feel like it must be pretty lame.|26_2]]", "created": "201410031548", "modified": "201410031548", "title": "26", "modifier": "twee"}, {"tags": ["inline"], "text": "\"I'm here to see Dr. Li,\" you say to the girl at the front desk. She recognizes you, and tells you that the doctor will be right out.\n\nHe is, indeed, quick, and [[you walk into his office a few minutes later|27_2]].", "created": "201410031548", "modified": "201410031548", "title": "27", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett that when you were 15, your mom would yell at you if she so much as heard you opening a cabinet in the kitchen. She would tell you that you weren't fat, you were just overweight, and that you needed to eat less. [[\"You don't look as good as you could,\"|20_2]] she'd say.", "created": "201410031548", "modified": "201410031548", "title": "20", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett that you've always felt like you were fat. Your mom definitely always thought you were fat, although she would never say it outright. She'd say things like \"you snack too much,\" or [[\"your pants are too tight.\"|21_2]]", "created": "201410031548", "modified": "201410031548", "title": "21", "modifier": "twee"}, {"tags": ["inline"], "text": "Your food is steamy. Suddenly you're ravenous. You eat a few forkfuls and lean back onto the couch. Emmett goes to get you both some water, and [[you take another bite|22_1]].", "created": "201410031548", "modified": "201410031548", "title": "22", "modifier": "twee"}, {"tags": ["inline"], "text": "You wake up, and Emmett's sitting on the couch with his laptop in the living room. He sees you roll over, and walks into your room and gets into the bed. He pulls you over and squeezes you. \n\n[[\"Morning--how are you feeling?\"|23_2]] he says.", "created": "201410031548", "modified": "201410031548", "title": "23", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "mom 2", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "crying 3", "modifier": "twee"}, {"tags": ["list"], "text": "eosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\neosinophilic esophagitis\n\n[[Your head feels like an echo chamber and your stomach feels like a living creature, fighting to expel itself from your body.|29]]", "created": "201410031548", "modified": "201410031548", "title": "28", "modifier": "twee"}, {"tags": ["inline"], "text": "\"Eosinophilic esophagitis,\" said Dr. Li, \"essentially means that there are rings on the inside of your esophagus--inflamed rings. These rings are what's making it difficult for you to swallow. The burning sensation in your stomach is the gastritis. Unfortunately, [[eosinophilic esophagitis doesn't have any proven treatment.\"|29_2]]", "created": "201410031548", "modified": "201410031548", "title": "29", "modifier": "twee"}, {"tags": ["inline"], "text": "You dip your spoon into the bowl, bringing up a pool of broth to your lips. You take a sip, and it feels warm and nice. You swallow, and [[it feels like the liquid is scraping the rings on your esophagus away.|48_2_3]]", "created": "201410031548", "modified": "201410031548", "title": "48_2_2", "modifier": "twee"}, {"tags": ["list"], "text": "\"How was that?\" asks Emmett.\n\nYou nod with approval, and scoop up a few of the noodles. You eat them, chewing thoroughly, and everything goes well. You start to feel full.\n\n[[Finish the soup.|to52]]", "created": "201410031548", "modified": "201410031548", "title": "48_2_3", "modifier": "twee"}, {"tags": ["list"], "text": "You don't really like talking to your mom. All she cares about is your weight, and if you bought any new clothes recently. Sometimes she asks how school is going, but she never seems very interested in the details.\n\n[[Call your boyfriend instead.|7]]\n[[Go to the kitchen for a snack.|8]]", "created": "201410031548", "modified": "201410031548", "title": "4", "modifier": "twee"}, {"tags": ["inline"], "text": "You used to download a lot of anime. You would lock yourself in the computer room for days at a time, just watching all of these shows. Your mom would always yell at you for \"being lazy.\" Your dad once got so annoyed that he ripped the computer off the desk and held it out the window like he was going to drop it, unless, he said, \"you turn off all the damn video games and cartoons and go outside.\"\n\nEmmett opens his eyes really big and says, [[\"he ripped it out of the wall? Oh my god.\"|18_dinner_3]]", "created": "201410031548", "modified": "201410031548", "title": "18_dinner_2", "modifier": "twee"}, {"tags": ["list"], "text": "You nod, and sprinkle some cheese on your pasta. You tell him that your dad was pretty mean, but your mom was always way worse because she was passive aggressive. \n\n[[Tell him how your mom always made you feel guilty.|19_dinner]]\n[[Tell him about the time your ripped all of your moms magazines up.|21_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "18_dinner_3", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "swallow 4", "modifier": "twee"}, {"tags": [], "text": "Mangia", "created": "201410031548", "modified": "201410031548", "title": "StoryTitle", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "swallow 6", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "swallow 2", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "swallow 3", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Take the rest of the day off?\"|34_emmett_10]] he asks.", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_9", "modifier": "twee"}, {"tags": ["inline"], "text": "You hesitate, but you decide to tell him the truth, [[\"...yeah, for breakfast.\"|50_4]]", "created": "201410031548", "modified": "201410031548", "title": "50_3", "modifier": "twee"}, {"tags": ["inline"], "text": "Every second, in a steady beat, a sharp pain stabbed the very middle of your chest. You're confused and horrified. \"I have no idea what's going on inside my body,\" you say, and you're crying. You curl up into a ball and press your forehead into your knees. [[You're wondering if you'll die.|esophagus]]", "created": "201410031548", "modified": "201410031548", "title": "22_6_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You pause, and say [[\"oatmeal.\"|50_2]]", "created": "201410031548", "modified": "201410031548", "title": "50_1", "modifier": "twee"}, {"tags": [], "text": "A gastroenterologist is a doctor that specializes in the digestive system, which is also referred to as the gastrointestinal (GI) tract.\n\n<<back>>", "created": "201410031548", "modified": "201410031548", "title": "gastroenterologist", "modifier": "twee"}, {"tags": ["list"], "text": "Emmett frowns, \"You're not a very good liar--you know that. That's your dinner, and you should eat as much of it as you can. I can't watch you starve yourself.\"\n\n[[Tell him that it's too stressful to eat.|51]]\n[[Don't say anything.|51]]", "created": "201410031548", "modified": "201410031548", "title": "50_4", "modifier": "twee"}, {"tags": ["img"], "text": "docs,30", "created": "201410031548", "modified": "201410031548", "title": "docs", "modifier": "twee"}, {"tags": ["list"], "text": "There's an old man in a worn-out plaid coat standing next to a young man with a leather suitcase. The old man's eyes are shut, and the young man is reading something on his iPad. \n\nYou think that the old man has probably had a hard life--you wonder if he has a job, or a family. You don't think he ever had an iPad, and you feel bitter towards the young man, who gets off at this stop. You have to get off too, and you wonder if the old man will ever get off the train.\n\n[[You walk a few blocks to the doctor's office.|27]]", "created": "201410031548", "modified": "201410031548", "title": "26_3", "modifier": "twee"}, {"tags": ["inline"], "text": "It's 9:00 AM, so everyone on the subway looks like they're heading to work. You pause your music, and the train is silent, except for the hiss of the engine and the momentary clash of wheels on the tracks. \n\nYou play your music again--the noises in the subway make you feel lonely. [[Everyone looks so sad.|26_3]]", "created": "201410031548", "modified": "201410031548", "title": "26_2", "modifier": "twee"}, {"tags": ["inline"], "text": "\"I feel so full, it hurts,\" you say.\n\nEmmett rubs your back, and asks if it would feel better to lie down. You say that it would, and that you think you just ate too much. The two of you walk into your room and lie down together. [[You fall asleep.|53]]", "created": "201410031548", "modified": "201410031548", "title": "52_4", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "mom", "modifier": "twee"}, {"tags": ["list"], "text": "Your cell phone is buzzing--it's mom.\n\n[[Answer.|3]]\n[[Ignore.|4]]", "created": "201410031548", "modified": "201410031548", "title": "2", "modifier": "twee"}, {"tags": ["list"], "text": "Having sex seems to make Emmett feel better though, which makes you happy.\n\nYou run to the bathroom to brush your teeth--the black spots on the ceiling are still there. You text your landlord, because he was supposed to take care of that a while ago.\n\n[[You throw on some clothes and head to the doctor's.|26]]", "created": "201410031548", "modified": "201410031548", "title": "24_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You have sex, but you're not super into it--you have a lot of trouble getting your mind off of the pain from last night. It doesn't hurt anymore, but you can't stop thinking about it, [[no matter how good the sex feels.|24_3]]", "created": "201410031548", "modified": "201410031548", "title": "24_2", "modifier": "twee"}, {"tags": ["inline"], "text": "Mom answers, and without any kind of greeting says, [[\"What happened? You talked to the doctor?\"|31_mom_2]]", "created": "201410031548", "modified": "201410031548", "title": "31_mom", "modifier": "twee"}, {"tags": ["img2"], "text": "fries,59&fish,60", "created": "201410031548", "modified": "201410031548", "title": "58", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett answers, [[\"Hello? How'd it go?\"|31_emmett_2]]", "created": "201410031548", "modified": "201410031548", "title": "31_emmett", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett sighs, [[\"Ok... I'm worried about you though. Can you stay on the phone until you get back to work?\"|34_emmett_3]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett that when you were 15, your mom would yell at you for snacking, or even going into the kitchen at all. She wasn't messing around--one cabinet creak and she'd be on the scene. \n\nShe would tell you that you weren't fat, you were just overweight, and that you needed to eat less. [[\"You don't look as good as you could,\"|17_dinner_2]] she'd say.", "created": "201410031548", "modified": "201410031548", "title": "17_dinner", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,61", "created": "201410031548", "modified": "201410031548", "title": "59", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Hey, I'm outside,\"|49_3]] it's Emmett.", "created": "201410031548", "modified": "201410031548", "title": "49_2", "modifier": "twee"}, {"tags": ["list"], "text": "You hesitate, staying on the phone does sound nice... but you don't want to bother Emmett at work.\n\n\"Don't worry--this is just something I'm going to have to deal with.\"\n\n[[Forever, you say to yourself.|34_emmett_4]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_3", "modifier": "twee"}, {"tags": ["img"], "text": "mom,22_6", "created": "201410031548", "modified": "201410031548", "title": "22_5", "modifier": "twee"}, {"tags": ["inline"], "text": "Your stomach feels hot and full, almost bursting. The heat in your stomach rises like a baloon, and you feel it sharply in your chest. Nausea rolls over you, forcing you to the edge of the couch, hunched and quiet. Emmett is still enjoying his food, and he looks over at you.\n\n\"Are you alright? You look really pale...\" he says.\n\nYou tell him that your chest is in pain. Your chest is in severe pain and [[you have no idea why|22_5]].", "created": "201410031548", "modified": "201410031548", "title": "22_4", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"I know... I know it's scary to eat right now, but you really need to. What kinds of food did the doctor recommend?\"|46_4]] he asks. You're not sure what you'd do without Emmett sometimes, he's so much more level-headed than you.", "created": "201410031548", "modified": "201410031548", "title": "46_3", "modifier": "twee"}, {"tags": ["inline"], "text": "Why would your chest start hurting suddenly? Were you choking? It almost felt like choking, or like someone had taken your esophagus and was [[twisting it round and round until it was taut.|22_6_2]]", "created": "201410031548", "modified": "201410031548", "title": "22_6", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,22_2", "created": "201410031548", "modified": "201410031548", "title": "22_1", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"What did you eat today?\"|50_1]] he asks.", "created": "201410031548", "modified": "201410031548", "title": "50", "modifier": "twee"}, {"tags": ["img"], "text": "mom,22_4", "created": "201410031548", "modified": "201410031548", "title": "22_3", "modifier": "twee"}, {"tags": ["inline"], "text": "Your chest feels tight--it's almost like asthma. It couldn't be though, because you would be wheezing. Emmett brings water and you gulp some down. It feels good and relaxes your throat. You eat more--[[you're almost done|22_3]].", "created": "201410031548", "modified": "201410031548", "title": "22_2", "modifier": "twee"}, {"tags": ["list"], "text": "The pasta is probably ready now. Emmett tells you that he wants you to feel good about yourself, and that he hopes that your doing ok. He knows how hard it can be for you to talk to your mom. \n\n[[Eat up.|tomid]]", "created": "201410031548", "modified": "201410031548", "title": "20_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell him how one day, when you were 15, you decided to see if your mom would care if you had an eating disorder. You really wanted her to worry about you--to feel bad for terrorizing you about your weight. You went into the bathroom and turned on the faucet, and dropped handfuls of water into the toilet to make it sound like you were puking. [[You could hear her walking by the bathroom, but she never said anything.|20_3]]", "created": "201410031548", "modified": "201410031548", "title": "20_2", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,65", "created": "201410031548", "modified": "201410031548", "title": "63", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett about how you were always snacking as a kid. You'd finish an entire bag of goldfish in an hour flat. Then, you'd call up your friend Kate and you'd both laugh about it. [[You were both always eating absurd amounts of goldfish together.|19_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "19_dinner", "modifier": "twee"}, {"tags": ["inline"], "text": "He says, [[\"Okay... it makes sense that you're upset, and that you might have a panic attack... just don't... lose hope. When you feel low, I know you feel really low. It's important to try your best to take care of yourself right now. How can I help you?\"|34_emmett_12]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_11", "modifier": "twee"}, {"tags": ["inline"], "text": "You pause, shivering, [[\"I'm just feeling really freaked out. I need to get back to work. I'm here now. It's ok. I love you. I'll see you tonight.\"|34_emmett_13]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_12", "modifier": "twee"}, {"tags": ["list"], "text": "\"Ok, but please call me if you need to talk. I love you so much,\" he says, and hangs up.\n\n[[Call mom.|31_mom]]\n[[Wash your face in the bathroom.|37]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_13", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"...I'm sorry, that was insensitive of me. I'm really sorry. Where are you now?\"|34_emmett_7]] he says.", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_6", "modifier": "twee"}, {"tags": ["img2"], "text": "soup,75&fish,76", "created": "201410031548", "modified": "201410031548", "title": "73", "modifier": "twee"}, {"tags": ["list"], "text": "[[Which will you eat?|58]]", "created": "201410031548", "modified": "201410031548", "title": "57", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,22", "created": "201410031548", "modified": "201410031548", "title": "tomid", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Uhh I just haven't been feeling great,\"|6_1_8]] you say, ready for the conversation to be over.", "created": "201410031548", "modified": "201410031548", "title": "6_1_7", "modifier": "twee"}, {"tags": ["list"], "text": "Emmett says he doesn't blame you for wanting pizza. He says that it must have driven you crazy, to feel like your eating habits were being policed.\n\n[[You nod and wrap some pasta around your fork.|tomid]]", "created": "201410031548", "modified": "201410031548", "title": "19_dinner_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You would also eat food in secret, because you sometimes felt too guilty to eat while your mom was around. You'd tell her that you were going to meet up with some friends to go for a walk, but really, you'd all walk downtown to get a pizza. [[Sometimes, you'd even take money out of her wallet so that you could buy candy from the dollar store.|19_dinner_3]]", "created": "201410031548", "modified": "201410031548", "title": "19_dinner_2", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,57", "created": "201410031548", "modified": "201410031548", "title": "56", "modifier": "twee"}, {"tags": ["list"], "text": "There's a short silence between the two of you. \n\n\"Are you crying? Maybe you should get a hot chocolate or something, maybe it'll make you feel better?\"\n\n[[His worried tone gives you a fresh pang of sadness, and you squeee your eyes shut.|34_emmett_5]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_4", "modifier": "twee"}, {"tags": ["inline"], "text": "You can see the noodles from last night, and all the tough vegetables, on your white plate.\n\n\"The steroid inhaler isn't very good for you--but you must know that, because of your asthma. Let's give it a try, [[but I'll need to check on you fairly frequently.\"|29_5]]", "created": "201410031548", "modified": "201410031548", "title": "29_4", "modifier": "twee"}, {"tags": ["list"], "text": "He continues to tell you about the dangers of steroids, and the kinds of foods you should avoid--but all you can think about are the white plates at your apartment, full of food.\n\n[[You leave with a prescription, and a follow-up appointment in a  month.|docs]]", "created": "201410031548", "modified": "201410031548", "title": "29_5", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett looks at you, sad and worried, [[\"Nina, please eat something. I will make you anything you want.\"|46_2_2]]", "created": "201410031548", "modified": "201410031548", "title": "46_2", "modifier": "twee"}, {"tags": ["list"], "text": "\"I'm sorry...\" says Emmett, \"I can't know what it's like. I do know, though, that you need to eat something. If you chew your pasta really, really well, I'm sure it will be ok. I'm here with you now, in case anything does happen.\"\n\n[[You do feel better now that you're not alone.|51_2]]", "created": "201410031548", "modified": "201410031548", "title": "51", "modifier": "twee"}, {"tags": ["inline"], "text": "You start breathing a little quicker, feeling anxious, [[\"If I eat anything, I will puke.\"|34_emmett_6]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_5", "modifier": "twee"}, {"tags": ["inline"], "text": "He tells you that he'll review the results of the endoscopy with you, and that he wants you to ask any questions that you might have. \n\n[[Questions...?|27_3]] You shift in your seat, leaning on the arm rest.", "created": "201410031548", "modified": "201410031548", "title": "27_2", "modifier": "twee"}, {"tags": [], "text": "\"Gastroesophageal reflux (GER) occurs when stomach contents flow back up into the esophagus\u2014the muscular tube that carries food and liquids from the mouth to the stomach.\" -National Institute of Diabetes and Digestive and Kidney Diseases (NIDDK)", "created": "201410031548", "modified": "201410031548", "title": "acid_reflux", "modifier": "twee"}, {"tags": ["inline"], "text": "You put on some water to boil in the kitchen, and apologize for not having any pasta sauce. \n\nYou cuddle and make-out while the water heats up, but you're feeling stressed out... [[your mom has been bothering you a lot lately.|19_2]]", "created": "201410031548", "modified": "201410031548", "title": "19", "modifier": "twee"}, {"tags": ["list"], "text": "You're standing on the corner of the corner of Lafayette and Grand St. You still have to go to work, but you're stuck. It's like your body is being crushed by the weight of a steel anchor. You can't even blink.\n\n[[\"Are you ok?\" he asks.|crying]]", "created": "201410031548", "modified": "201410031548", "title": "31_emmett_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You do your best to keep the apartment clean, but the building is old and dusty. You're pretty sure there's mold in there too, somewhere. The dust gives you asthma sometimes. Dark, dirty places always stress you out... [[it's just an asthma trigger waiting to happen.|8_3]]", "created": "201410031548", "modified": "201410031548", "title": "8_2", "modifier": "twee"}, {"tags": ["list"], "text": "There's not much in your kitchen cupboards.\n\n[[Take out the Cheez-It's.|10]]\n[[Prepare dinner for two, because your boyfriend is coming over later.|9]]", "created": "201410031548", "modified": "201410031548", "title": "8_3", "modifier": "twee"}, {"tags": ["plain"], "text": "The end.", "created": "201410031548", "modified": "201410031548", "title": "82", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,74", "created": "201410031548", "modified": "201410031548", "title": "72", "modifier": "twee"}, {"tags": ["inline"], "text": "It feels like there's a balloon expanding inside of your stomach. You feel it getting bigger and bigger, stretching your gut beyond comfort. It's just like last night--with your insides heating up like a furnace. [[You bring your knees up to your forehead, squeezing yourself tight into a ball.|52_2]]", "created": "201410031548", "modified": "201410031548", "title": "52", "modifier": "twee"}, {"tags": ["inline"], "text": "You say, [[\"I really love you, and I need to see you tonight. If you come over after work...\"|33_emmett_2]]", "created": "201410031548", "modified": "201410031548", "title": "33_emmett", "modifier": "twee"}, {"tags": ["inline"], "text": "You're really sobbing now.\n\nYou ask him, [[\"Emmett... what do I do?\"|34_emmett_9]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_8", "modifier": "twee"}, {"tags": ["list"], "text": "Emmett asks you if you ever actually had an eating disorder.\n\n[[Tell him about that one doctor's appointment...|20_dinner]]\n[[Tell him that you didn't--you were too obsessed with food to not eat it.|19_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "17_dinner_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell him how one day, when you were 15, you decided to see if your mom would care if you had an eating disorder. You really wanted her to worry about you--to feel bad for terrorizing you about your weight. You went into the bathroom and turned on the faucet, and dropped handfuls of water into the toilet to make it sound like you were puking. You could hear her walking by the bathroom, [[but she never said anything|17_dinner_3]].", "created": "201410031548", "modified": "201410031548", "title": "17_dinner_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You swallow the pasta, and feel every piece sliding down your throat and into your esophagus. You feel like it's taking forever, and your heart starts beating [[faster, and faster|swallow]].", "created": "201410031548", "modified": "201410031548", "title": "45_2", "modifier": "twee"}, {"tags": ["list"], "text": "You see some black stains on the ceiling above you in the reflection. You have to remember to get your landlord to come check it out--it might be mold, you think.\n\n[[Have some Cheeze-It's while the water heats up.|10_dinner]]\n[[Shut the bathroom door and look in the full-length mirror.|11_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "9_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You look at yourself in the mirror and remember being really little, like 12 years old, at a birthday party. This girl whose birthday party it was... well, she was very athletic, and proud of it. She told everyone at the party (we were all girls) to lift their shirts up so that we could see who had the flattest tummy. \n\nYou had always been pretty round as a child. You weren't huge, but you definitely felt like [[your stomach protruded more than all of the other girls.|13_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "13_dinner", "modifier": "twee"}, {"tags": ["list"], "text": "You empty the pot into a streamer and put the pasta in a bowl. You top it off with some olive oil and pepper, and sit on the couch. \n\nAs you roll up the pasta and bring it closer to your mouth, you feel your throat get tight. You tell yourself that you need to eat--you don't want to starve. \n\n[[Chew, and swallow.|45]]\n[[It's too risky--put the fork down.|43]]", "created": "201410031548", "modified": "201410031548", "title": "42_2", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Why didn't you answer any of my calls this weekend,\"|3_1]] asks mom.", "created": "201410031548", "modified": "201410031548", "title": "3", "modifier": "twee"}, {"tags": ["inline"], "text": "You hesitate, [[\"I haven't eaten. I can't eat.\"|46_3]]", "created": "201410031548", "modified": "201410031548", "title": "46", "modifier": "twee"}, {"tags": ["list"], "text": "He answers the phone and you can hear cars honking in the background. \n\n[[\"Hey, how's it going?\" he says.|7_2]]", "created": "201410031548", "modified": "201410031548", "title": "7", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,28", "created": "201410031548", "modified": "201410031548", "title": "27_9", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"What exactly happened?\"|31_emmett2_3]] asks Emmett, who sounds upset, which just makes you feel worse.", "created": "201410031548", "modified": "201410031548", "title": "31_emmett2_2", "modifier": "twee"}, {"tags": ["list"], "text": "You sigh, and consider it for a second...\n\n[[\"I can't take any more days off work... and they know I'm not sick, I was already in this morning. But, I'm afraid if I go in... everyone will see me panicking.\"|34_emmett_11]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_10", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett looks at you, [[\"Are you ok?\"|52_3]] he asks.", "created": "201410031548", "modified": "201410031548", "title": "52_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You feel dizzy and nauseous. You wish you would just throw it all up--it would be better than feeling like this. Like your stomach might explode. \n\n[[\"Hey...\"|52_4]] says Emmett.", "created": "201410031548", "modified": "201410031548", "title": "52_3", "modifier": "twee"}, {"tags": ["inline"], "text": "The work day goes by quickly. You spend most of it thinking about what you're going to eat for dinner. Definitely not noodles, you thought, especially after last night... that pain. All you have other than that, though, is chicken. The doctor said chicken was a choking hazard. [[You feel nauseous just thinking about it.|36_3]]", "created": "201410031548", "modified": "201410031548", "title": "36_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You're not like super horny or anything--but, if you have sex, you think that you'll be in a much better mood. Honestly, you woke up feeling emotionally drained, like you had just lost a pet cat or something. [[You really need a reminder that you're not alone, especially right before this potentially awful doctor's appointment.|24_2]]", "created": "201410031548", "modified": "201410031548", "title": "24", "modifier": "twee"}, {"tags": ["list"], "text": "\"Obviously I'm crying,\" you say, squinting your eyes and looking at the ground.\n\n[[You're not sure why you were suddenly so harsh. You feel like you've lost control over your body.|32_emmett_3]]", "created": "201410031548", "modified": "201410031548", "title": "32_emmett_2", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"I'll come meet you--where are you?\"|32_emmett_4]] asks Emmett. His sounds desperate--you've never heard him use that tone before.", "created": "201410031548", "modified": "201410031548", "title": "32_emmett_3", "modifier": "twee"}, {"tags": ["list"], "text": "You pause, \"No, don't, I'm ok.\"\n\n[[Tell him that you have to go.|34_emmett]]\n[[Tell him that you love him.|33_emmett]]", "created": "201410031548", "modified": "201410031548", "title": "32_emmett_4", "modifier": "twee"}, {"tags": ["list"], "text": "\"Ok, I'll try to finish it,\" you say, determined.\n\nYou take another bite, and another, chewing as thoroughly as you can. You feel a wave of anxiety wash over you every time you swallow, but you remind yourself that you're not alone. If anything happens, Emmett will help you.\n\n[[You start to feel full very quickly.|to52]]", "created": "201410031548", "modified": "201410031548", "title": "51_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett about how, the other day, your mom called and harassed you about the gym again. You tell him how stressed out you felt after--\"I honestly just wanted to go straight to bed when I hung up,\" you said. [[You tell him that you wish you could just lost weight overnight.|16_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "16_dinner", "modifier": "twee"}, {"tags": ["img"], "text": "crying,31_mom2", "created": "201410031548", "modified": "201410031548", "title": "momcry", "modifier": "twee"}, {"tags": ["list"], "text": "He tells you that he thinks you look beautiful the way you are, and that you don't need to lose weight, no matter what your mom says.\n\n[[Continue to talk to Emmett about the issues with your mom.|20]]\n[[Tell him that you're always going to be fat.|21]]", "created": "201410031548", "modified": "201410031548", "title": "19_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett about how, the other day, your mom called and harassed you about the gym again. You tell him how stressed out you felt after--\"I honestly just wanted to go straight to bed when I hung up,\" you said. [[You tell him that you wish you could just lost weight overnight.|19_3]]", "created": "201410031548", "modified": "201410031548", "title": "19_2", "modifier": "twee"}, {"tags": ["inline"], "text": "He says that you should put on Trigun, since you'd already started watching it together last night. While you put it on, you tell Emmett that your teenage self would have probably [[marathoned the entire show in a single night.|18_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "18_dinner", "modifier": "twee"}, {"tags": ["img"], "text": "pasta,chicken", "created": "201410031548", "modified": "201410031548", "title": "pasta", "modifier": "twee"}, {"tags": ["list"], "text": "It's five.\n\n[[Go home.|43]]\n[[Go to the grocery store.|38]]", "created": "201410031548", "modified": "201410031548", "title": "36_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You try to keep your voice steady, [[\"I'm exhausted and upset. I think I need to just go back to work and sit in the bathroom for a while. I'll see you tonight?\"|34_emmett_2]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "chicken 2", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 8", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 9", "modifier": "twee"}, {"tags": ["inline"], "text": "You head home with peanut butter cookies, a box of Cheez-It's and angel hair pasta. You figure that angel hair is so light that it won't bother you... hopefully. [[Otherwise, you might not eat anything.|39_2]]", "created": "201410031548", "modified": "201410031548", "title": "39", "modifier": "twee"}, {"tags": ["list"], "text": "You don't normally think about the sheer amount of food in the grocery store, but you can't help feeing the weight of it today. Walking through the sliding doors feels like jumping into a pool, your belly smacking flat onto the water.\n\nGranola bars, string cheese, ramen, potato rolls, steak, rice, asparagus, salad, hot sauce, clams, lamb, hamburger, bacon, cereal, stew...\n\nGranola bars, string cheese, ramen, potato rolls, steak, rice, asparagus, salad, hot sauce, clams, lamb, hamburger, bacon, cereal, stew...\n\nGranola bars, string cheese, ramen, potato rolls, steak, rice, asparagus, salad, hot sauce, clams, lamb, hamburger, bacon, cereal, stew...\n\nGranola bars, string cheese, ramen, potato rolls, steak, rice, asparagus, salad, hot sauce, clams, lamb, hamburger, bacon, cereal, stew...\n\nThere's so much food.\n\n[[Decide that you're not hungry after all.|40]]\n[[Buy a bunch of different things, hoping that you'll be able to eat any of it.|39]]", "created": "201410031548", "modified": "201410031548", "title": "38", "modifier": "twee"}, {"tags": ["list"], "text": "You are in disbelief--you always knew that your mom was harsh, but it seems totally insane that she'd be insensitive about your sudden condition. You can barely contain your anger. You wonder if you'll ever stop crying.\n\nMore importantly, though, you're almost back at work, and your face is a mess. You're not sure you want anyone to see you like this.\n\n[[Wash your face in the bathroom.|37]]\n[[Go to your desk.|36]]", "created": "201410031548", "modified": "201410031548", "title": "33_mom", "modifier": "twee"}, {"tags": ["img"], "text": "docs,56", "created": "201410031548", "modified": "201410031548", "title": "55", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 2", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 3", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 4", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 5", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 6", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin 7", "modifier": "twee"}, {"tags": ["img"], "text": "chicken,fries", "created": "201410031548", "modified": "201410031548", "title": "chicken", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett that, as a kid, you'd always hold onto your pent up anger until it just burst out. You never understood how to express your anger when, for example, she'd buy you pants that were just a little too tight. It felt like her passive agressive way of telling you to lose weight. [[You always wished she'd just yell at you instead, so that you could at least let off some steam.|21_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "21_dinner", "modifier": "twee"}, {"tags": ["inline"], "text": "You head out with Emmett--it's too cold outside. On top of that, you're pretty sad that you missed the opportunity to have sex. [[You don't like the fact that stress seems to be destroying your libido.|25_3]]", "created": "201410031548", "modified": "201410031548", "title": "25_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You pause, trying to breathe steadily, [[\"I'm sorry mom--I'm just so exhausted and upset. I'll talk to you later.\"|35_mom_2]]", "created": "201410031548", "modified": "201410031548", "title": "35_mom", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "crying 2", "modifier": "twee"}, {"tags": ["list"], "text": "He takes the subway with you for a few stops, but has to get off before you. He kisses you, and tells you that he'll come over again tonight. He wants you to let him know what happens as soon as you get out of the doctor's appointment. \n\n[[You wave goodbye.|26]]", "created": "201410031548", "modified": "201410031548", "title": "25_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You're not sure that you understand what the doctor is saying anymore. [[All you know is that everything around you feels and sounds loud.|29_3]]", "created": "201410031548", "modified": "201410031548", "title": "29_2", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "mom 3", "modifier": "twee"}, {"tags": ["img"], "text": "apple,pasta", "created": "201410031548", "modified": "201410031548", "title": "apple", "modifier": "twee"}, {"tags": ["inline"], "text": "\"However, of course, we need to deal with your issues swallowing. There's a treatment that's... not well studied, but I've used it with other patients and some found success. You will need to take two puffs of a steroid inhaler daily--puffing onto your tongue, and swallowing the substance. You'll also need to avoid foods that are not easy to chew, like chicken, because [[you're at higher risk for choking that the average person.\"|29_4]]", "created": "201410031548", "modified": "201410031548", "title": "29_3", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "crying 4", "modifier": "twee"}, {"tags": ["list"], "text": "Your friend walked around, commenting on everyone's stomach. She got to you, a poked you hard, right above the belly button. You could almost hear a squishing sound in your head, and she said \"your tummy is so round, Nina!\"\n\n[[Your phone has been buzzing. Check it out.|14]]", "created": "201410031548", "modified": "201410031548", "title": "13_2", "modifier": "twee"}, {"tags": ["list"], "text": "\"Ok, hold on,\" you say.\n\nYou go downstairs to let him in. He shuts the door and hugs you. The two of you stand together, and it's warm. You lean your forehead into his shoulder and shut your eyes.\n\n[[Tell him that you haven't eaten dinner.|46]]\n[[Lie, and tell him that you ate before he got there.|47]]", "created": "201410031548", "modified": "201410031548", "title": "44_3", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "crying 5", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,62", "created": "201410031548", "modified": "201410031548", "title": "60", "modifier": "twee"}, {"tags": ["img2"], "text": "apple,64&fries,63", "created": "201410031548", "modified": "201410031548", "title": "61", "modifier": "twee"}, {"tags": ["img2"], "text": "apple,64&chicken,63", "created": "201410031548", "modified": "201410031548", "title": "62", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett says, [[\"Hey, I'm outside.\"|44_3]]", "created": "201410031548", "modified": "201410031548", "title": "44_2", "modifier": "twee"}, {"tags": ["img2"], "text": "swallow,66", "created": "201410031548", "modified": "201410031548", "title": "64", "modifier": "twee"}, {"tags": ["img2"], "text": "banana,67&bread,68", "created": "201410031548", "modified": "201410031548", "title": "65", "modifier": "twee"}, {"tags": ["img2"], "text": "cheese,67&grapes,68", "created": "201410031548", "modified": "201410031548", "title": "66", "modifier": "twee"}, {"tags": ["inline"], "text": "The water at work is always freezing. It's alright though, because you went to the bathroom on the first floor--no one ever uses it, so you're alone. You can deal with the cold water as long as you're alone. You stand in front of the mirror and stare at your face. You look pale and feel small, like your head's shrinking. [[Even your blood feels thin.|37_2]]", "created": "201410031548", "modified": "201410031548", "title": "37", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,70", "created": "201410031548", "modified": "201410031548", "title": "68", "modifier": "twee"}, {"tags": ["img2"], "text": "cracker,71&pasta,72", "created": "201410031548", "modified": "201410031548", "title": "69", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,23", "created": "201410031548", "modified": "201410031548", "title": "esophagus", "modifier": "twee"}, {"tags": ["inline"], "text": "You say, [[\"I was really tired. Last week was stressful and I just wanted to relax.\"|3_2]]", "created": "201410031548", "modified": "201410031548", "title": "3_1", "modifier": "twee"}, {"tags": ["list"], "text": "You sit silently for a moment, thinking about all the foods that the doctor said you shouldn't eat. It imagine that he said \"you can't eat anything ever again or you'll choke\" but you know that's not true. He said that soup was a good option...\n\n[[Tell Emmett that you want soup.|48]]\n[[Tell him that you want whatever.|48_2]]", "created": "201410031548", "modified": "201410031548", "title": "46_2_2", "modifier": "twee"}, {"tags": ["list"], "text": "You're pretty annoyed that she didn't even care to ask why you'd been stressed.\n\n[[Tell her you have to go, because you have homework to do, and hang up.|4]]\n[[Hear her out.|5]]", "created": "201410031548", "modified": "201410031548", "title": "3_3", "modifier": "twee"}, {"tags": ["inline"], "text": "She sounds exasperated--[[\"I don't see why you'd be stressed. You know, Kevin and I went out to the mall yesterday and...\"|3_3]]", "created": "201410031548", "modified": "201410031548", "title": "3_2", "modifier": "twee"}, {"tags": ["annotation"], "text": "38 and 28 talk about animation", "created": "201410031548", "modified": "201410031548", "title": "Untitled Annotation 1", "modifier": "twee"}, {"tags": ["inline"], "text": "The water is boiling, and you're stirring the angel hair around. The water is cloudy and steamy. The steam feels good in your lungs--[[you feel like it's flushing something out of you.|42_2]]", "created": "201410031548", "modified": "201410031548", "title": "42", "modifier": "twee"}, {"tags": ["list"], "text": "You arrive together back at the apartment with your food. Emmett tells you that he wants you to feel good about yourself, because he thinks you're the cutest girl ever. \n\n[[Eat up.|tomid]]", "created": "201410031548", "modified": "201410031548", "title": "17_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell him how one day, when you were 15, you decided to see if your mom would care if you had an eating disorder. You really wanted her to worry about you--to feel bad for terrorizing you about your weight. You went into the bathroom and turned on the faucet, and dropped handfuls of water into the toilet to make it sound like you were puking. [[You could hear her walking by the bathroom, but she never said anything.|17_3]]", "created": "201410031548", "modified": "201410031548", "title": "17_2", "modifier": "twee"}, {"tags": ["list"], "text": "You say, \"Sure!\"\n\n[[Suggest that you get take-out from M Noodle.|16]]\n[[Offer to make some pasta.|19]]", "created": "201410031548", "modified": "201410031548", "title": "15_3", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett asks, [[\"Want to watch some anime and eat dinner? I'm starving.\"|15_3]]", "created": "201410031548", "modified": "201410031548", "title": "15_2", "modifier": "twee"}, {"tags": ["inline"], "text": "You've never been in a relationship for this long--in fact, you've been dumped by every other guy you've dated after 6 months, like clockwork. You worry that Emmett too will realize that you're not really all that great... that you're sort of an emotional wreck, most of the time, and that you have some self-loathing issues. [[If he figures all that out, you think he'll definitely break up with you...|15_2]]", "created": "201410031548", "modified": "201410031548", "title": "15_1", "modifier": "twee"}, {"tags": ["inline"], "text": "You made a stupid tweet about Pokemon earlier and it got a bunch of retweets. In one sense, you feel proud and validated by it, and in another sense [[you're wondering why you care so much about how strangers on the internet feel about you.|14_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "14_dinner", "modifier": "twee"}, {"tags": [], "text": "[[\"I don't want to eat anything,\"|32_mom_2]] you say, weakly.", "created": "201410031548", "modified": "201410031548", "title": "32_mom", "modifier": "twee"}, {"tags": ["inline"], "text": "Mom continues, [[\"It was. Then we left the mall because Kevin needed to use the bathroom, and you know, we're still doing the potty training thing.\"|6_1]]", "created": "201410031548", "modified": "201410031548", "title": "6", "modifier": "twee"}, {"tags": ["inline"], "text": "You feel a sob tear through your throat and into the phone. You're not sure what you're more upset about--showing your mom how weak you are, or your newly diagnosed esophagitis.\n\nYou tell her, [[\"I'm not ok, I have a condition.\"|31_mom2_2]]", "created": "201410031548", "modified": "201410031548", "title": "31_mom2", "modifier": "twee"}, {"tags": ["inline"], "text": "Your phone starts buzzing, and you feel the pasta sink past the middle of your chest. It's ok, you tell yourself, it's fine.\n\nYou answer the call, [[\"...Hello?\"|49_2]]", "created": "201410031548", "modified": "201410031548", "title": "49", "modifier": "twee"}, {"tags": ["list"], "text": "You're feeling exhausted after being in the supermarket. All of that food...\n\n[[Go to bed without eating.|41]]\n[[Make the angel hair. |42]]", "created": "201410031548", "modified": "201410031548", "title": "39_2", "modifier": "twee"}, {"tags": ["img"], "text": "crying,31_emmett2", "created": "201410031548", "modified": "201410031548", "title": "crying", "modifier": "twee"}, {"tags": ["list"], "text": "You're a little anxious about the appointment, but you think it'll go fine. \n\n[[Emmett's calling--he must be outside.|15]]", "created": "201410031548", "modified": "201410031548", "title": "14_2", "modifier": "twee"}, {"tags": ["list"], "text": "You rub a cheap paper towel on your face, and it leaves you more red than before. You're not sure that you can avoid looking like a wreck at this point. \n\n[[Return to your desk.|36]]", "created": "201410031548", "modified": "201410031548", "title": "37_2", "modifier": "twee"}, {"tags": ["list"], "text": "Emmett says, \"I love you too--bye!\" and hangs up.\n\n[[Get a snack from the kitchen.|8]]\n[[Begin to prepare dinner for two.|9]]", "created": "201410031548", "modified": "201410031548", "title": "7_9", "modifier": "twee"}, {"tags": ["inline"], "text": "You look in the mirror and lift your shirt up. You stare at your stomach--it feels full and uncomfortable. [[It's odd, because you haven't eaten in a few hours.|11_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "11_dinner", "modifier": "twee"}, {"tags": ["list"], "text": "\"My esophagus is swollen... there's these rings. It's called eosinophilic esophagitis. That's... I have to eat soft things now. I can have soup. No chicken. No Vegetables. No Popcorn... I could choke.\"\n\n[[Tell Emmett you're worn out and upset.|34_emmett]]\n[[Tell Emmett that you're fine, and that you don't want to bother him at work.|32_emmett]]", "created": "201410031548", "modified": "201410031548", "title": "31_emmett2_3", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "apple 2", "modifier": "twee"}, {"tags": ["inline"], "text": "The kitchen is dark. You live in a railroad style apartment, which means that the only two rooms that get any natural light are on either end of the place. You're lucky that you picked a bedroom with windows. [[Otherwise, you'd feel smothered.|8_2]]", "created": "201410031548", "modified": "201410031548", "title": "8", "modifier": "twee"}, {"tags": [], "text": "\"A hernia happens when part of an internal organ or tissue bulges through a weak area of muscle. Most hernias are in the abdomen.\" -U.S. National Library of Medicine", "created": "201410031548", "modified": "201410031548", "title": "hernia", "modifier": "twee"}, {"tags": ["list"], "text": "You walk out of the supermarket. The sun is so bright, and you feel lightheaded. Being surrounded by food is no good, you think to yourself. It's just too much right now. \n\nYou walk back to your apartment slowly. You're so tired.\n\n[[Go to bed.|43]]\n[[Make some pasta.|42]]", "created": "201410031548", "modified": "201410031548", "title": "40", "modifier": "twee"}, {"tags": ["list"], "text": "You look in the mirror and lift your shirt up. You stare at your stomach--it feels full and uncomfortable. You stand there staring at your stomach, and wonder why you stopped going to the gym. You would like to blame grad school, but you also feel honestly too tired to go. \n\nYou think your mom would probably kill you if she saw you in a swimsuit. \n\n[[Continue to look in the mirror.|13]]\n[[Go back into the kitchen.|12]]", "created": "201410031548", "modified": "201410031548", "title": "11", "modifier": "twee"}, {"tags": ["list"], "text": "You remember, when you were a teenager, you'd always have a box of Cheez-It's handy while you were playing video games. You would literally eat an entire box in a night, sometimes, and your mom would yell at you and tell you to join a gym.\n\nYou eat a bunch of Cheez-It's and start to feel full. \n\n[[Go into a the bathroom and look in the full-length mirror.|10_3]]\n[[There are a bunch of dirty dishes. Wash them.|10_2]]", "created": "201410031548", "modified": "201410031548", "title": "10", "modifier": "twee"}, {"tags": ["inline"], "text": "You look at yourself in the mirror and remember being really little, like 12 years old, at a birthday party. This girl whose birthday party it was... well, she was very athletic, and proud of it. She told everyone at the party (we were all girls) to lift their shirts up so that we could see who had the flattest tummy. \n\nYou had always been pretty round as a child. [[You weren't huge, but you definitely felt like your stomach protruded more than all of the other girls.|13_2]]", "created": "201410031548", "modified": "201410031548", "title": "13", "modifier": "twee"}, {"tags": ["inline"], "text": "Your mom has always been a little OCD about cleaning. Your house growing up was totally spotless--literally every wall was white, [[the floors were a pristine pastel blue and the furniture was minimal.|12_2]]", "created": "201410031548", "modified": "201410031548", "title": "12", "modifier": "twee"}, {"tags": ["inline"], "text": "You run downstairs and open the door for Emmett. \n\nYou have been dating Emmett for seven or eight months. His apartment is in Manhattan, and it's tiny, so he usually stays over at your place. In fact, [[he basically stays over every night.|15_1]]", "created": "201410031548", "modified": "201410031548", "title": "15", "modifier": "twee"}, {"tags": ["inline"], "text": "You made a stupid tweet about Pokemon earlier and it got a bunch of retweets. That's pretty cool. \n\nYou also have a calendar notification for tomorrow--a doctor's appointment. It's with a gastroenterologist. You got an endoscopy recently, because you'd been having some weird stomach and chest pain. Everyone says it's probably just acid reflux, but your aunt has a hernia, so they told you [[it was best to get checked anyways.|14_2]]", "created": "201410031548", "modified": "201410031548", "title": "14", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett that when you were 15, your mom would yell at you for snacking, or even going into the kitchen at all. She wasn't messing around--one cabinet creak and she'd be on the scene. \n\nShe would tell you that you weren't fat, you were just overweight, and that you needed to eat less. [[\"You don't look as good as you could,\"|17_2]] she'd say.", "created": "201410031548", "modified": "201410031548", "title": "17", "modifier": "twee"}, {"tags": ["inline"], "text": "You each order your usuals--vegetable lo mein for you and pork dumplings for him. You cuddle and make-out for ten or fifteen minutes before you decide [[it's time to walk over and pick up the food.|16_2]]", "created": "201410031548", "modified": "201410031548", "title": "16", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Sure, ok, I love you. See you soon,\"|7_9]] you say, feeling a sense of relief. Spending time with Emmett every night is your main source of relaxation.", "created": "201410031548", "modified": "201410031548", "title": "7_8", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett that you've always felt like you were fat. Your mom definitely always thought you were fat, although she would never say it outright. She'd say things like \"you snack too much,\" or [[\"your pants are too tight.\"|18_2]]", "created": "201410031548", "modified": "201410031548", "title": "18", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"I just got diagnosed with a DISEASE and you're going to tell me that it's a good thing? This is insane. I should probably just kill myself. Maybe then you'd be satisfied with my body,\"|34_mom_2]] you say, tears burning your face.", "created": "201410031548", "modified": "201410031548", "title": "34_mom", "modifier": "twee"}, {"tags": ["img"], "text": "fries,pizza", "created": "201410031548", "modified": "201410031548", "title": "fries", "modifier": "twee"}, {"tags": ["img"], "text": "crying,52", "created": "201410031548", "modified": "201410031548", "title": "to52", "modifier": "twee"}, {"tags": ["inline"], "text": "You say, [[\"I don't want to. I'm not even hungry.\"|46_5]]", "created": "201410031548", "modified": "201410031548", "title": "46_4", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Want to watch some anime and eat dinner? I'm starving,\"|15_dinner_4]] says Emmett.", "created": "201410031548", "modified": "201410031548", "title": "15_dinner_3", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "docs 3", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,11", "created": "201410031548", "modified": "201410031548", "title": "10_3", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"For breakfast?\"|50_3]] asks Emmett.", "created": "201410031548", "modified": "201410031548", "title": "50_2", "modifier": "twee"}, {"tags": ["list"], "text": "The kitchen was always especially clean. The dishes were always either hand-washed or put into the dishwasher directly after any meal, without question. The plates were all white or clear--no stains or cracks. Every pot was always gleaming and silver. Even the smallest burn on a pot would make my mom throw it into the trash.\n\n[[Go into the bathroom and look in the full-length mirror.|13]]\n[[Check your phone--it's been buzzing.|14]]", "created": "201410031548", "modified": "201410031548", "title": "12_2", "modifier": "twee"}, {"tags": ["list"], "text": "[[Call Emmett.|31_emmett]]\n[[Call mom.|31_mom]]", "created": "201410031548", "modified": "201410031548", "title": "30", "modifier": "twee"}, {"tags": ["inline"], "text": "You're not totally paying attention to what she's saying, but you don't want her to know that. [[\"Yeah,\" you say.|6_1_2]]", "created": "201410031548", "modified": "201410031548", "title": "6_1", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,4", "created": "201410031548", "modified": "201410031548", "title": "6_2", "modifier": "twee"}, {"tags": ["img"], "text": "crying,55", "created": "201410031548", "modified": "201410031548", "title": "54", "modifier": "twee"}, {"tags": ["inline"], "text": "The pants thing always bothered you--especially because your mom's pant size was much smaller than your own, even when you were a teenager. She could fit into a 0, while you were always a 10. She would try to motivate you to lose weight by saying [[\"I have so many cute clothes that I could give you, if only you'd go to the gym a couple times a week.\"|21_3]]", "created": "201410031548", "modified": "201410031548", "title": "21_2", "modifier": "twee"}, {"tags": ["list"], "text": "The pasta is probably ready. Emmett tells you that he wants you to feel good about yourself, and that he hopes that you're doing ok.\n\n[[Eat up.|tomid]]", "created": "201410031548", "modified": "201410031548", "title": "21_3", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "swallow 5", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell him, [[\"I'm just... standing here. I can't really believe it... why is this happening?\"|34_emmett_8]]", "created": "201410031548", "modified": "201410031548", "title": "34_emmett_7", "modifier": "twee"}, {"tags": ["list"], "text": "You remember, when you were a teenager, you'd always have a box of Cheez-It's handy while you were playing video games. You would literally eat an entire box in a night, sometimes, and your mom would yell at you and tell you to join a gym.\n\nYou eat a bunch of Cheez-It's and start to feel full. \n\n[[Go into a the bathroom and look in the full-length mirror.|11_dinner]]\n[[Check to see if the water is boiling.|12_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "10_dinner", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "pasta 2", "modifier": "twee"}, {"tags": ["inline"], "text": "You pause, [[\"Oatmeal.\"|46_7]]", "created": "201410031548", "modified": "201410031548", "title": "46_6", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"What did you eat today?\"|46_6]] he asks.", "created": "201410031548", "modified": "201410031548", "title": "46_5", "modifier": "twee"}, {"tags": ["list"], "text": "You smile, \"Sure! I made some pasta.\"\n\n[[While you serve the pasta, tell Emmett about the issues you've been having with you mom.|16_dinner]]\n[[Bring the food back and put on Netflix so that you can watch some anime.|18_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "15_dinner_4", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,12", "created": "201410031548", "modified": "201410031548", "title": "10_2", "modifier": "twee"}, {"tags": ["list"], "text": "You've never been in a relationship for this long--in fact, you've been dumped by every other guy you've dated after 6 months, like clockwork. You worry that Emmett too will realize that you're not really all that great... that you're sort of an emotional wreck, most of the time, and that you have some self-loathing issues. If he figures all that out, he'll definitely break up with you... \n\n[[You go up into your apartment together, kiss, and sit down on the couch.|15_dinner_3]]", "created": "201410031548", "modified": "201410031548", "title": "15_dinner_2", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Ok, well... can I come over tonight?\"|7_6]] he asks.", "created": "201410031548", "modified": "201410031548", "title": "7_5", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"I can't--I've already taken off too many days lately,\"|7_5]] you say.", "created": "201410031548", "modified": "201410031548", "title": "7_4", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"Yeah. I'll be over in an hour. I'm gonna run and get my bag together, ok?\"|7_8]] he asks.", "created": "201410031548", "modified": "201410031548", "title": "7_7", "modifier": "twee"}, {"tags": ["inline"], "text": "[[\"I was hoping you'd like to. I just got off the phone with my mom, so I'm sort of stressed out. You know how it goes.\"|7_7]] You hear Emmett groan on the other end.", "created": "201410031548", "modified": "201410031548", "title": "7_6", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,81", "created": "201410031548", "modified": "201410031548", "title": "80", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett pauses and says, [[\"You've been really tired lately... it's weird. Maybe you should take a day off from work?\"|7_4]]", "created": "201410031548", "modified": "201410031548", "title": "7_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You sigh, [[\"I'm alright--so tired though.\"|7_3]]", "created": "201410031548", "modified": "201410031548", "title": "7_2", "modifier": "twee"}, {"tags": ["inline"], "text": "Your grandfather, Nanoo, always had a healthy appetite. He would inhale your Nana's dinners without pause, and would always ask for more. [[He loved to eat.|81_2]]", "created": "201410031548", "modified": "201410031548", "title": "81", "modifier": "twee"}, {"tags": ["inline"], "text": "It's a cold night, March 2nd, and your 23rd birthday is coming right up. You hope it gets warmer by then.\n\nYou tell Emmett about how, the other day, your mom called and harassed you about going to the gym again. You tell him how awful it felt, that it made you want to crawl into bed and never come out. [[You tell him that you wish you could just lose weight overnight.|16_3]]", "created": "201410031548", "modified": "201410031548", "title": "16_2", "modifier": "twee"}, {"tags": ["list"], "text": "He tells you that he thinks you look beautiful the way you are, and that you don't need to lose weight, no matter what your mom says.\n\nHe always tells you this. You've had self-esteem issues for your entire life, and he's been subjected to many hours of your self-loathing monologues. It's a miracle that he puts up with it.\n\n[[Continue to talk to Emmett about the issues with your mom.|17]]\n[[Tell him that you're always going to be fat.|18]]", "created": "201410031548", "modified": "201410031548", "title": "16_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You hear yourself saying \"a condition\" in your head. You're saying it over and over.\n\n[[\"Well--tell me what he said,\"|31_mom2_3]] she asks.", "created": "201410031548", "modified": "201410031548", "title": "31_mom2_2", "modifier": "twee"}, {"tags": ["inline"], "text": "\"My esophagus is swollen... there's these rings. It's called eosinophilic esophagitis. That's... I have to eat soft things now...\"\n\nYou could choke, you say to yourself, but it's so hard to make the words come out... \n\n[[\"I could choke,\"|31_mom2_4]] you blurt it out and shiver.", "created": "201410031548", "modified": "201410031548", "title": "31_mom2_3", "modifier": "twee"}, {"tags": ["list"], "text": "There's also a calendar notification for tomorrow: \"Gastro Appt\". You're going to get checked by a gastroenterologist, Dr. Li. He performed an endoscopy on you recently, because you'd been having some weird stomach and chest pain. Everyone says it's probably just acid reflux, but your aunt has a hernia, so they told you it was best to get checked anyways. \n\nYou're a little anxious about the appointment, but you think it'll go fine. \n\n[[Emmett's calling--he must be outside.|15_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "14_dinner_2", "modifier": "twee"}, {"tags": [], "text": "\"Upper GI endoscopy is a procedure that uses a lighted, flexible endoscope to see inside the upper GI tract. The upper GI tract includes the esophagus, stomach, and duodenum\u2014the first part of the small intestine.\" -National Institute of Diabetes and Digestive and Kidney Diseases (NIDDK)\n\n<<back>>", "created": "201410031548", "modified": "201410031548", "title": "endoscopy", "modifier": "twee"}, {"tags": ["inline"], "text": "The pants thing always bothered you--especially because your mom's pant size was much smaller than your own, even when you were a teenager. She could fit into a 0, while you were always a 10. She would try to motivate you to lose weight by saying [[\"I have so many cute clothes that I could give you, if only you'd go to the gym a couple times a week.\"|18_3]]", "created": "201410031548", "modified": "201410031548", "title": "18_2", "modifier": "twee"}, {"tags": ["list"], "text": "You arrive together back at the apartment with your food. Emmett tells you that he wants you to feel good about yourself, and that he hopes that you're doing ok.\n\n[[Eat up.|tomid]]", "created": "201410031548", "modified": "201410031548", "title": "18_3", "modifier": "twee"}, {"tags": ["list"], "text": "\"So, you just need to get a blender and watch what you eat,\" your mom says, sounding totally unconcerned.\n\n[[Hang up on your mom.|33_mom]]\n[[Tell her that you're afraid to swallow anything.|32_mom]]", "created": "201410031548", "modified": "201410031548", "title": "31_mom2_4", "modifier": "twee"}, {"tags": ["list"], "text": "The thought of eating makes you nauseous. All you can think about is choking.\n\n[[You need to lie down.|43]]", "created": "201410031548", "modified": "201410031548", "title": "41", "modifier": "twee"}, {"tags": ["inline"], "text": "You haven't been feeling like yourself. In fact, you think it's been months since you've really felt normal. Although, honestly, you're not even sure what you mean by \"feeling normal\" -- you do know, that it's not how you're feeling [[now|1_2]].", "created": "201410031548", "modified": "201410031548", "title": "1", "modifier": "twee"}, {"tags": ["list"], "text": "\"Nina, that's not fair. You shouldn't say things like that. I'm just trying to help. You need to be more healthy now that you have this condition,\" she says.\n\n[[Tell her that you're sorry.|35_mom]]\n[[Hang up.|33_mom]]", "created": "201410031548", "modified": "201410031548", "title": "34_mom_2", "modifier": "twee"}, {"tags": ["list"], "text": "\"Ok, hold on,\" you say.\n\nYou go downstairs to let him in. He shuts the door and hugs you. The two of you stand together, and it's warm. You lean your forehead into his shoulder and shut your eyes.\n\n[[Tell him that you just tried to swallow some pasta, but it was scary.|51]]\n[[Tell him that you already ate, so you saved this last bowl of pasta in case he hadn't.|50]]", "created": "201410031548", "modified": "201410031548", "title": "49_3", "modifier": "twee"}, {"tags": ["list"], "text": "Mom continues to talk without letting you get a word in, \"It was so funny! Here I was, with Kevin, and he was trying to get me to buy this Teletubbies DVD. This woman walks by us and I'm like, she looks really familiar. Then, someone yells out her name, they yell Hollis! And I realized that she was one of the famous models from the 70s that I'd been shot with a few times...\"\n\n[[Cut her off--tell her you have homework to do and hang up.|4]]\n[[Tell her, \"Cool, that must have been exciting.\"|6]]", "created": "201410031548", "modified": "201410031548", "title": "5", "modifier": "twee"}, {"tags": ["inline"], "text": "You're starting to wonder what you're going to eat today. You haven't even had lunch, to be honest, but [[your stomach feels too battered right now to even consider eating.|36_2]]", "created": "201410031548", "modified": "201410031548", "title": "36", "modifier": "twee"}, {"tags": ["inline"], "text": "You decide to make some pasta, because you're not a very good cook and it's a really easy thing to make. While you wait for it to boil, [[you go into your bathroom to look in the mirror.|9_2]]", "created": "201410031548", "modified": "201410031548", "title": "9", "modifier": "twee"}, {"tags": ["list"], "text": "\"Yeah,\" you say.\n\n[[Tell him you're tired and that you want to go to bed.|47]]\n[[Sit down on the couch and wait.|48]]", "created": "201410031548", "modified": "201410031548", "title": "46_8", "modifier": "twee"}, {"tags": ["img"], "text": "pizza,44", "created": "201410031548", "modified": "201410031548", "title": "pizza", "modifier": "twee"}, {"tags": ["list"], "text": "He tells you that he thinks you look beautiful the way you are, and that you don't need to lose weight, no matter what your mom says.\n\n[[Tell him more about how your mom made you feel as a kid.|17_dinner]]\n[[Ask him which anime he wants to watch.|18_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "16_dinner_2", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "begin", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,27_4", "created": "201410031548", "modified": "201410031548", "title": "27_3", "modifier": "twee"}, {"tags": ["inline"], "text": "\"You don't have a hernia,\" he says, \"but there were a few issues.\"\n\n[[You feel a little bubble expanding in your stomach|27_5]], a faint reminder of last nights dinner.", "created": "201410031548", "modified": "201410031548", "title": "27_4", "modifier": "twee"}, {"tags": ["img"], "text": "begin,begin_on,27_6", "created": "201410031548", "modified": "201410031548", "title": "27_5", "modifier": "twee"}, {"tags": ["inline"], "text": "\"You have a mild case of gastritis, which will go away after a couple weeks of medication. It's really not a big deal at all--some inflamation of the tissue in your stomach.\"\n\nYou can feel your chest rising and falling with each one of your breaths, [[in and out|27_7]].", "created": "201410031548", "modified": "201410031548", "title": "27_6", "modifier": "twee"}, {"tags": ["hoverimg"], "text": "begin,begin_on,27_8", "created": "201410031548", "modified": "201410031548", "title": "27_7", "modifier": "twee"}, {"tags": ["list"], "text": "\"You also have...\" and he shuffled around some papers on his desk, pulling out a photo of... something pink--clearly, a picture of something in your body. \n\n[[\"You have a condition called eosinophilic esophagitis.\"|27_9]]", "created": "201410031548", "modified": "201410031548", "title": "27_8", "modifier": "twee"}, {"tags": ["list"], "text": "You stand there staring at your stomach, and wonder why you stopped going to the gym. You would like to blame grad school, but you really just feel too tired to go most of the time. \n\nYou think your mom would probably kill you if she saw you in a swimsuit. \n\n[[Check to see if the water is boiling.|12_dinner]]\n[[Continue to look at yourself in the mirror.|13_dinner]]", "created": "201410031548", "modified": "201410031548", "title": "11_dinner_2", "modifier": "twee"}, {"tags": ["inline"], "text": "He loved you and wanted you to grow up healthy and strong. He taught you how to spell your first word--milk. He made you spell it out loud: M-I-L-K. Then, he would take out a fountain pen, and you would write it clumsily onto his yellow notepad. [[He said that you needed to drink a lot of it--it would help you grow.|81_3]]", "created": "201410031548", "modified": "201410031548", "title": "81_2", "modifier": "twee"}, {"tags": ["inline"], "text": "At night, he would sit you down with a bowl of pasta and meatballs and he'd tell you \"Mangia, Nina! Mangia!\" He told you that it meant [[\"Eat up!\"|81_4]]", "created": "201410031548", "modified": "201410031548", "title": "81_3", "modifier": "twee"}, {"tags": ["inline"], "text": "He's not around anymore, but you'll never forget the oak table and the cupboard of antique china. His olive skin and black hair, and his low voice telling you to eat up. [[To live and eat and grow.|82]]", "created": "201410031548", "modified": "201410031548", "title": "81_4", "modifier": "twee"}, {"tags": ["img2"], "text": "banana,79&apple,80", "created": "201410031548", "modified": "201410031548", "title": "77", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,78", "created": "201410031548", "modified": "201410031548", "title": "76", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,77", "created": "201410031548", "modified": "201410031548", "title": "75", "modifier": "twee"}, {"tags": ["img2"], "text": "bread,75&fries,76", "created": "201410031548", "modified": "201410031548", "title": "74", "modifier": "twee"}, {"tags": ["list"], "text": "Emmett tells you that you still say that about yourself now, and that he wishes you wouldn't, because you look really good. You laugh, and look down at your pasta.\n\n[[Eat up.|tomid]]", "created": "201410031548", "modified": "201410031548", "title": "20_dinner_3", "modifier": "twee"}, {"tags": ["inline"], "text": "You talked with the doctor about how huge you thought you looked when you saw yourself in the mirror--you looked like a whale, or a monster, you said, and that you saw cellulite all over your body. She told you that you might have Body Dysmorphic Disorder, because, she said, [[\"You look normal to me.\"|20_dinner_3]]", "created": "201410031548", "modified": "201410031548", "title": "20_dinner_2", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,73", "created": "201410031548", "modified": "201410031548", "title": "71", "modifier": "twee"}, {"tags": ["img2"], "text": "cheese,71&carrot,72", "created": "201410031548", "modified": "201410031548", "title": "70", "modifier": "twee"}, {"tags": ["list"], "text": "You smile a little--you're glad you won't need to spend the night alone. That would be miserable. You say, \"I know... ok, I'm walking into my office now. I'll talk to you tonight. I love you.\"\n\n[[Call mom.|31_mom]]\n[[Wash your face in the bathroom.|37]]", "created": "201410031548", "modified": "201410031548", "title": "33_emmett_3", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett sighs, [[\"Of course I'll come over--I just wish neither of us had to work now.\"|33_emmett_3]]", "created": "201410031548", "modified": "201410031548", "title": "33_emmett_2", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,49", "created": "201410031548", "modified": "201410031548", "title": "swallow", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,81", "created": "201410031548", "modified": "201410031548", "title": "79", "modifier": "twee"}, {"tags": ["img2"], "text": "cheese,79&soup,80", "created": "201410031548", "modified": "201410031548", "title": "78", "modifier": "twee"}, {"tags": ["inline"], "text": "You tell Emmett about how, when you were 16 or 17, you had your first doctor's appointment that your mom didn't come to. She dropped you off and went to run from errands, because it was just a regular check-up. \n\nOf course, you always get weighed at check-ups, so she weighed you, and you were 145 pounds. She told you that 145 pounds was about average for your height and age, but that it was maybe a little more weight than I needed by 2 or 3 pounds. You told her that you weren't surprised, and that your mom was always saying that you were overweight, [[and that you thought you looked really fat.|20_dinner_2]]", "created": "201410031548", "modified": "201410031548", "title": "20_dinner", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "docs 2", "modifier": "twee"}, {"tags": ["Twine.image"], "text": "data:image/png;base64,", "created": "201410031548", "modified": "201410031548", "title": "fries 2", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett makes you a bowl of chicken noodle soup. The bowl is full, and it looks huge to you. You can't imagine eating the whole thing, but you'll try. You know that Emmett is right--starving isn't good. [[No matter how tempting it is, at this point.|48_2_2]]", "created": "201410031548", "modified": "201410031548", "title": "48", "modifier": "twee"}, {"tags": ["list"], "text": "You tell him that you're feeling ok--just sort of drained. Last night was rough. You tell him that you've got to get going because you have that doctor's appointment. \n\n[[Have sex, and show up to your appointment a little late.|24]]\n[[Go take a shower and walk to the train with Emmett.|25]]", "created": "201410031548", "modified": "201410031548", "title": "23_2", "modifier": "twee"}, {"tags": ["list"], "text": "You nod with approval, going in for another mouthful. You eat, chewing thoroughly, and everything goes well. You start to feel full.\n\n[[Finish the soup.|to52]]", "created": "201410031548", "modified": "201410031548", "title": "48_5", "modifier": "twee"}, {"tags": ["inline"], "text": "You dip your spoon into the bowl, bringing up a pool of broth to your lips. You take a sip, and it feels warm and nice. You swallow--it feels like the liquid is scraping the rings on your esophagus away.\n\nEmmett puts his hand on your back, [[\"How was that?\"|48_5]]", "created": "201410031548", "modified": "201410031548", "title": "48_4", "modifier": "twee"}, {"tags": ["inline"], "text": "One time, you were angry at her for telling you to go running. You had been going running, in fact, but you were too sore to go that day. She said you should suck it up and go--that it would be good for you. [[You accused her of calling you lazy and fat again, and the two of you fought for a while.|21_dinner_3]]", "created": "201410031548", "modified": "201410031548", "title": "21_dinner_2", "modifier": "twee"}, {"tags": ["list"], "text": "Eventually, the fight escalated so much that you quietly went into her room, took out a stack of her fashion magazines and ripped them to shreds. You scattered the shreds all around the house and refused to pick them up. She was livid, to say the least.\n\nYou roll up some pasta onto your fork.\n\n[[Eat up.|tomid]]", "created": "201410031548", "modified": "201410031548", "title": "21_dinner_3", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett makes you a bowl of chicken noodle soup. It looks huge to you. You can't imagine eating the whole thing, but you'll try. You know that Emmett is right--starving isn't good. [[No matter how tempting it is, at this point.|48_4]]", "created": "201410031548", "modified": "201410031548", "title": "48_3", "modifier": "twee"}, {"tags": ["inline"], "text": "\"Soup...\" you say, after a while.\n\nYou say it and feel weak. [[You feel nauseous even thinking about eating, but you know that it's for the best.|48_3]]", "created": "201410031548", "modified": "201410031548", "title": "48_2", "modifier": "twee"}, {"tags": ["list"], "text": "You can feel your face getting hot. You know that you're easily provoked by your mom, because she often jumps to conclusions before you're ready to hear them. You feel like she's being insensitive.\n\nMom says, \"Try to think about the positive side. This will help you have a better diet. You'll lose some weight.\"\n\n[[Hang up on your mom.|33_mom]]\n[[Continue arguing with her.|34_mom]]", "created": "201410031548", "modified": "201410031548", "title": "32_mom_2", "modifier": "twee"}, {"tags": ["inline"], "text": "Emmett looks at you, closely, and asks [[\"...for breakfast?\"|46_8]]", "created": "201410031548", "modified": "201410031548", "title": "46_7", "modifier": "twee"}, {"tags": ["list"], "text": "\"I'm going to make you soup. I can't watch you starve yourself,\" says Emmett, moving towards the kitchen.\n\n[[Tell him you're tired and that you want to go to bed.|48_2]]\n[[Sit down on the couch and wait.|48]]", "created": "201410031548", "modified": "201410031548", "title": "47", "modifier": "twee"}, {"tags": ["list"], "text": "\"Ok, call me tonight,\" she says, and hangs up.\n\n[[Wash your face in the bathroom.|37]]\n[[Stand outside and try to calm down.|33_mom]]", "created": "201410031548", "modified": "201410031548", "title": "35_mom_2", "modifier": "twee"}, {"tags": ["img"], "text": "swallow,69", "created": "201410031548", "modified": "201410031548", "title": "67", "modifier": "twee"}, {"tags": ["inline"], "text": "You jerk suddenly and wake up--your phone is vibrating. It's Emmett.\n\nYou answer, [[\"...Hello?\"|44_2]]", "created": "201410031548", "modified": "201410031548", "title": "44", "modifier": "twee"}, {"tags": ["inline"], "text": "You're walking slowly towards work. Your feet are dragging, like they're slogging through wet cement. Your whole body feels like it's being pulled into the ground by a rip tide. You can barely breathe.\n\n\"Hello? Nina?\" [[says mom, sounding as annoyed as ever.|momcry]]", "created": "201410031548", "modified": "201410031548", "title": "31_mom_2", "modifier": "twee"}]}
